// ratingstars.jsx

import React from 'react';
import location from "../locations.json";
import Star from "../assets/star.png";
import "../Locations.css"; 

const RatingStars = ({ rating }) => {
    // Convert rating to a number
    const ratingNumber = parseInt(location.rating);

    // Array to store JSX elements representing stars
    const stars = [];

    // Loop to create the number of stars based on the rating
    for (let i = 0; i < 5; i++) {
        // Determine if the current star should be colored
        const isColored = i < ratingNumber;

        // Create the JSX element for the star with dynamic color based on rating
        stars.push(
            <div className={`star ${isColored ? 'red' : ''}`} key={i}>
             <img src="../assets/star.png" alt="" className="Star" />
            </div>
        );
    }

    return <div className="rating-stars">{stars}</div>;
};

export default RatingStars;
